import ai.djl.translate.TranslateException;

public class Main {

	public static void main(String[] args) {
		try {

//			String input = "";
			String input = "";

			// chuyển file thành byte64
//			BufferedImage bufferedImage = ImageIO.read(new File("face.jpg"));
//			ByteArrayOutputStream baos = new ByteArrayOutputStream();
//			ImageIO.write(bufferedImage, "jpg", baos);
//			String encodeToString = Base64.getEncoder().encodeToString(baos.toByteArray());
//			Files.write(Paths.get("output.txt"), encodeToString.getBytes(), StandardOpenOption.CREATE);

			byte[] decode = Base64.getDecoder().decode(input.getBytes());
			ByteArrayInputStream arrayInputStream = new ByteArrayInputStream(decode);
			BufferedImage bufferedImage = ImageIO.read(arrayInputStream);
			String path = System.getProperty("user.home") + "/BHX-Pos" + "/resnet50_ssd";
			System.out.println("Start Detect");

			System.out.println("new ObjectDetectionMXNet");
			ObjectDetectionMXNet detectionMXNet = new ObjectDetectionMXNet(path, bufferedImage);
			System.out.println("call method predict()");
			detectionMXNet.predict();
			System.out.println("end method predict()");
			System.out.println("call method getTopK()");
			List<BufferedImage> images = detectionMXNet.getTopK(2);
			System.out.println("end method getTopK()");
			System.out.println("List Images: " + images.size());
			System.out.println("End Detect");

			JPanel jPanel = new JPanel(new FlowLayout(FlowLayout.CENTER, 5, 5));
			for (BufferedImage image : images) {
				JLabel a = new JLabel(new ImageIcon(image));
				jPanel.add(a);
			}

			JFrame frame = new JFrame();
			frame.add(jPanel);
			frame.setSize(1200, 1280);
			frame.pack();
			frame.setDefaultCloseOperation(WindowConstants.EXIT_ON_CLOSE);
			frame.setLocationRelativeTo(null);
			frame.setVisible(true);
		} catch (IOException | ModelException | TranslateException e) {
			e.printStackTrace();
			try {
				Files.write(Paths.get(System.getProperty("user.home") + "/BHX-Pos" + "/log_testlib.txt"),
						e.getMessage().getBytes(), StandardOpenOption.CREATE, StandardOpenOption.WRITE,
						StandardOpenOption.APPEND);
			} catch (IOException e1) {
				e1.printStackTrace();
			}
		}

	}

}
